text:
 @picadediamante8492  tenho mais o que fazer, do que ficar lendo seus comentários, bicho doido.
 Quem não tem embasamento aqui é você, meteu um papo estranho que o corinthians é pequeno porque da torcida manter o ânimo, mesmo na derrota, sendo que é justamente nesses momentos que a torcida tem que trabalhar, alem do mais, ter uma quantidade absurda de torcedor fiel mostra que o time não é qualquer coisa.
Pelo visto, quando o Palmeiras entrar numa má fase, tu passará a torcer para outro time.
